import './App.css';
import Login from "./login/Login";
import { NavLink, BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="wrapper">
      <Routes>
        <Route path="/login" element={<b>Login page</b>} />
      </Routes>
    </div>
  )
}

export default App;
